import React from "react";
import { Navbar, Nav, Container, Button } from "react-bootstrap";
import { NavLink, Link } from "react-router-dom";

const Header = () => {
  return (
    <Navbar
      expand="lg"
      bg="white"
      className="shadow-sm py-3 sticky-top border-bottom"
    >
      <Container>
        {/* ===== Brand Logo / Name ===== */}
        <Navbar.Brand
          as={Link}
          to="/"
          className="fw-bold fs-4 text-primary d-flex align-items-center"
        >
          <img
            src="https://cdn-icons-png.flaticon.com/512/809/809957.png"
            alt="logo"
            width="35"
            height="35"
            className="me-2"
          />
          RealEstate<span className="text-dark">Hub</span>
        </Navbar.Brand>

        {/* ===== Toggle for Mobile ===== */}
        <Navbar.Toggle aria-controls="navbar-nav" />

        {/* ===== Nav Links ===== */}
        <Navbar.Collapse id="navbar-nav">
          <Nav className="ms-auto align-items-lg-center">
            <Nav.Link
              as={NavLink}
              to="/"
              end
              className="mx-2 text-dark fw-semibold"
              style={({ isActive }) =>
                isActive
                  ? { color: "#0d6efd", borderBottom: "2px solid #0d6efd" }
                  : {}
              }
            >
              Home
            </Nav.Link>

            <Nav.Link
              as={NavLink}
              to="/plots"
              className="mx-2 text-dark fw-semibold"
              style={({ isActive }) =>
                isActive
                  ? { color: "#0d6efd", borderBottom: "2px solid #0d6efd" }
                  : {}
              }
            >
              Plots
            </Nav.Link>

            <Nav.Link
              as={NavLink}
              to="/contact"
              className="mx-2 text-dark fw-semibold"
              style={({ isActive }) =>
                isActive
                  ? { color: "#0d6efd", borderBottom: "2px solid #0d6efd" }
                  : {}
              }
            >
              Contact
            </Nav.Link>

            {/* ===== Call-to-Action Button ===== */}
            <Button
              as={Link}
              to="/contact"
              variant="primary"
              className="ms-lg-3 mt-3 mt-lg-0 fw-semibold px-3"
            >
              Enquire Now
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
